import React from "react";
import ProfilePicture from "../avatar.jpg";

const Avatar = () =>
    <React.Fragment>
        <img src={ProfilePicture} alt="Steven McStravog" />
    </React.Fragment>;

const AboutMe = () =>
    <React.Fragment>
        <h1>Steven McStravog</h1>
        <p>I am a enthusiastic software engineer with several years industrial experience.</p>
    </React.Fragment>;

const About = () =>
    <React.Fragment>
        <Avatar />
        <AboutMe />
    </React.Fragment>;

export default About;
